const initialUserState = {
    name: null,
    aadharCardNumber: null,
    address: null
}

const userReducer = (state = initialUserState , action) => {
    switch( action.type ) {
        case 'USER_LOGEDIN': 
            return {
                ...state
            }
        default: 
            return {
                ...state
            }
    }
}
export default userReducer;
